script: |
  super -f text -I q2350.spq | sort > q2350.out

inputs:
  - name: q2350.spq
    data: |
      SELECT DISTINCT col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 79 * col2 NOT BETWEEN col0 / + 72 + - CAST ( NULL AS INTEGER ) / - + col2 AND + + col2;
  - name: tab1

outputs:
  - name: q2350.out
    data: |
      14
      47
      5
